webpackJsonp([66427673065113],{796:function(n,r){n.exports={data:{markdownRemark:{frontmatter:{title:"PODRASTI",type:"lyrics"},html:"<h1>PODRASTI</h1>\n<section>\n<p>Ah, mne by podrasti<br>\nNel'zja boltat' nogami<br>\nI lishnego prohozhim<br>\nAh, mne by podrasti</p>\n<p>Ah, mne by podrasti<br>\nKogo by sdelat' glavnym<br>\nSebja ili gitaru<br>\nAh, mne by podrasti</p>\n<p>Ah, mne by podrasti<br>\nI v patoke pechali<br>\nNashhupat' vse potoki<br>\nAh, mne by podrasti</p>\n<p>Ah, mne by podrasti<br>\nNebom zarasti<br>\nOt sih<br>\nDo sih<br>\nI vysmejat'sja v stih</p>\n<p>Ah, mne by podrasti<br>\nNyrjat' v chuzhuju vodu<br>\nVylechennoj chajkoj<br>\nMne by podrasti</p>\n<p>Ah, mne by podrasti<br>\nKalechit' tol'ko ruki,<br>\nKol'cevat'<br>\nAh, mne by podrasti</p>\n<p>Ah, mne by podrasti<br>\nPod derevom, pod kamnem<br>\nMjagkim mhom usnut'<br>\nMjagkim mhom usnut'</p>\n<p>Ah, mne by podrasti<br>\nDo radosti, do gorja<br>\nDorasti<br>\nDo vernosti i revnosti<br>\nMosti<br>\nDo tjortosti i krepkosti<br>\nPolzti<br>\nI derevo zasohshee<br>\nSpasti<br>\nSnesti ego<br>\nNa snasti<br>\nUvezti<br>\nAh mne by podrasti</p>\n<p>Mne by dorasti do ptah</p>\n</section>"},site:{siteMetadata:{languages:{defaultLangKey:"en",langs:["en","ru"]}}}},pathContext:{slug:"/en/lyrics/podrasti/"}}}});
